    <style>
        body { margin: 0; overflow: hidden; font-family: 'Helvetica Neue', Arial, sans-serif; background: #fff; color: #333; }

            position: absolute; right: -400px; top: 0; width: 350px; height: 100%;

            z-index: 200; transition: 0.4s cubic-bezier(0.25, 1, 0.5, 1);
            padding: 20px; box-sizing: border-box; display: flex; flex-direction: column; gap: 15px; overflow-y: auto;
        }
        #side-panel.open { right: 0; }
        .panel-close { align-self: flex-end; cursor: pointer; font-size: 24px; font-weight: bold; color: #999; }
        
        @media screen and (max-width: 768px) {
            #side-panel {
                right: 0; left: 0; bottom: -100%; top: auto;

        #status-log { position: absolute; bottom: 5px; left: 5px; z-index: 100; background: rgba(0,0,0,0.6); color: #0f0; padding: 5px 10px; font-size: 10px; border-radius: 3px; pointer-events: none; }

</head>
<body>

    <div id="ui-layer">
        <a href="" target="_blank" class="info-link">
            <span class="info-icon">?</span> このアプリについて
        </a>
        <div class="search-container">
            <input type="text" id="node-search" placeholder="女優検索..." autocomplete="off">
            <div id="search-results"></div>
        </div>
        <button class="btn" onclick="resetSelection()">全体を表示 / 解除</button>
    </div>

    <div id="side-panel">
        <span class="panel-close" onclick="closePanel()">×</span>
        <h2 id="panel-title" style="margin: 0; font-size: 24px;">Artist Name</h2>

    </div>

    <div id="status-log">Initializing...</div>
    <div id="cy"></div>

    <script>
        // JS部分はロジックに変更はありませんが、HTMLの修正に合わせて整理しました
        let cy;
        const logEl = document.getElementById('status-log');
        const searchInput = document.getElementById('node-search');
        const searchResults = document.getElementById('search-results');
        const sidePanel = document.getElementById('side-panel');

        const CONFIG = {
            gasUrl: "https://script.google.com/macros/s/AKfycbxLSa95r08HRbuQhEWUgVSUSeSaUmJxpA8fRZ4NVAbiGLhVA3kFkEdbEVIvlr2HWcAn/exec", 
            token: "my-secret-token-2026",
            baseNodeSize: 225, baseFontSize: 1500, edgeWidth: 35
        };

        function addLog(msg) { logEl.innerText = msg; }

        function adjustView(animate = true) {
            if (!cy) return;
            const isMobile = window.innerWidth < 768;
            cy.animate({ fit: { eles: cy.elements(), padding: isMobile ? 30 : 60 } }, { duration: animate ? 600 : 0 });
        }
        
        async function start() {
            addLog("データ読み込み中...");
            try {
                const fullData = getEmbeddedData();
                const elements = [];

                // --- 1. ノードデータの解析 ---
                const nHeaders = fullData.nodes[0]; // 1行目（見出し）を取得
                const nodeRows = fullData.nodes.slice(1); // 2行目以降（実データ）を取得

                nodeRows.forEach(row => {
                    // 配列をオブジェクト形式 {"id": "1", "label": "963"...} に変換
                    const n = Object.fromEntries(row.map((val, i) => [nHeaders[i], val]));
                    
                    elements.push({
                        group: 'nodes',
                        data: { 
                            id: String(n.id), 
                            label: n.label, 
                            color: n.color, 
                            size: parseFloat(n.size) * CONFIG.baseNodeSize 
                        },
                        position: { x: parseFloat(n.x), y: -parseFloat(n.y) }
                    });
                });

                // --- 2. エッジデータの解析 ---
                const eHeaders = fullData.edges[0]; // 1行目（見出し）を取得
                const edgeRows = fullData.edges.slice(1); // 2行目以降を取得

                const nodeIds = new Set(nodeRows.map(row => String(row[0]))); // IDは常に1番目(index 0)と仮定
                
                edgeRows.forEach(row => {
                    const e = Object.fromEntries(row.map((val, i) => [eHeaders[i], val]));
                    const s = String(e.source); 
                    const t = String(e.target);
                    
                    // 接続先ノードが存在するかチェックして追加
                    if (s !== t && nodeIds.has(s) && nodeIds.has(t)) {
                        elements.push({ group: 'edges', data: { source: s, target: t } });
                    }
                });

                // --- 3. Cytoscapeの描画（ここからは以前と同じ） ---
                cy = cytoscape({
                    container: document.getElementById('cy'),
                    elements: elements,
                    minZoom: 0.001, maxZoom: 0.5,
                    autoungrabify: true,
                    style: [
                        { selector: 'node', style: { 'width': 'data(size)', 'height': 'data(size)', 'label': 'data(label)', 'font-size': CONFIG.baseFontSize, 'background-color': 'data(color)', 'text-outline-width': 20, 'text-outline-color': '#fff', 'min-zoomed-font-size': 5 }},
                        { selector: 'edge', style: { 'width': CONFIG.edgeWidth, 'line-color': '#ccc', 'opacity': 0.2, 'curve-style': 'bezier' }},
                        { selector: '.faded', style: { 'opacity': 0.05, 'text-opacity': 0 }},
                        { selector: '.highlight-node', style: { 'z-index': 999, 'border-width': 60, 'border-color': '#000' }},
                        { selector: '.edge-out', style: { 'line-color': 'red', 'target-arrow-color': 'red', 'opacity': 1, 'target-arrow-shape': 'triangle' }},
                        { selector: '.edge-in', style: { 'line-color': 'blue', 'target-arrow-color': 'blue', 'opacity': 1, 'target-arrow-shape': 'triangle' }}
                    ],
                    layout: { name: 'preset' }
                });

                cy.on('tap', 'node', function(e){ 
                    selectNode(e.target); 
                    openPanel(e.target.data()); 
                });

                searchInput.addEventListener('input', (e) => {
                    const val = e.target.value.toLowerCase();
                    searchResults.innerHTML = '';
                    if (!val) { searchResults.style.display = 'none'; return; }
                    const matches = cy.nodes().filter(n => {
                        const lbl = n.data('label');
                        return lbl && typeof lbl === 'string' && lbl.toLowerCase().includes(val);
                    });
                    if (matches.length > 0) {
                        searchResults.style.display = 'block';
                        matches.slice(0, 10).forEach(m => {
                            const div = document.createElement('div');
                            div.className = 'search-item'; div.innerText = m.data('label');
                            div.onmousedown = (ev) => {
                                ev.preventDefault();
                                selectNode(m); 
                                openPanel(m.data());
                                cy.animate({ center: { eles: m }, zoom: 0.02 }, { duration: 1000 });
                                searchResults.style.display = 'none'; searchInput.value = m.data('label');
                            };
                            searchResults.appendChild(div);
                        });
                    } else { searchResults.style.display = 'none'; }
                });

                adjustView(false);
                addLog(`描画完了: ${fullData.nodes.length} nodes`);
            } catch (err) { addLog("Error: " + err.message); }
        }

        function selectNode(node) {
            const id = node.id();
            cy.elements().addClass('faded').removeClass('highlight-node edge-out edge-in');
            node.removeClass('faded').addClass('highlight-node');
            node.connectedEdges().forEach(edge => {
                edge.removeClass('faded');
                if (edge.source().id() === id) edge.addClass('edge-out');
                else edge.addClass('edge-in');
            });
            node.neighborhood().nodes().removeClass('faded');
        }
        
        function openPanel(data) {
            document.getElementById('panel-title').innerText = data.label;
            sidePanel.classList.add('open');
        }

        function closePanel() { sidePanel.classList.remove('open'); }
        
        function resetSelection() {
            closePanel();
            cy.elements().removeClass('faded highlight-node edge-out edge-in');
            searchInput.value = '';
            adjustView(true);
        }
        // 修正後：データの読み込み部分
        function getEmbeddedData() {
            const dataText = document.getElementById('gem_network_data').textContent;
            return JSON.parse(dataText);
        }
        
        window.addEventListener('resize', () => { adjustView(true); });
        start();
    </script>
    
</body>
</html>
